Aldrig har jeg elsker nogen mere end jeg elsker jer.
Aldrig har ville dø for nogen som jeg vil dø for jer.
Aldrig har jeg ville hente himlen ned til nogen som jeg vil til jer.
Aldrig har jeg frygtet at miste nogen som jeg frygter at miste jer. 
Aldrig har været så klar til kamp som jeg er for jer.
Aldrig har jeg mig så træt og frisk på en og samme tid som i kan få mig til at føle.
Aldrig har jeg været så lykkelig som i gør mig. 
Aldrig har jeg smilt så meget som jeg med jer. 
Aldrig har følt mig så magtesløs som i kan få mig til at føle.
Aldrig har jeg har så meget tålmodighed som i har fundet frem mig.
Aldrig har jeg haft så lidt tålmodighed som i kan give mig. 
Aldrig har ville trøste nogen en hel@nat før i kom ind i mit liv. 
Aldrig har jeg kunne klare flere nætter uden søvn som jeg har kunne med jer da i sprang nætter over.
Aldrig har jeg følt så meget glæde i livet som i bragt ind i mit liv.
Aldrig har jeg elsket så meget at det gør ondt før jeg fik jer. 

Jeg vil gøre alt for jer for altid. Jeg vil elske jer altid. Jeg hil altid støtte jer og guide jer igennem livet. Jeg vil altid være jeres beskytter. Jeg vil altid forsvare jer og kæmpe for jer. I er hele mit liv og hele min verden. I er grunden til at jeg bliver kaldt kedelig, men en ting er sikkert og det er at jeg gerne vil kaldes kedelig af veninder og venner for i er ikke små for altid og en dag vil i heller være ude med venner og tilbage sidder mor og far. Jeg vil ikke gå glip af øjeblikke med jer. Vi sammen hverdag og det kan tælles på 1 hånd hvor mange gange om året i bliver passet på samme tid, for tiden med jer kommer ikke igen. 

